DROP TABLE IF EXISTS `blindness`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `blindness` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `disease` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `city` varchar(255) DEFAULT NULL,
  `state` char(2) DEFAULT NULL,
  `link` varchar(255) DEFAULT NULL,
  `bbb_link` varchar(255) DEFAULT NULL,
  `facebook_link` varchar(255) DEFAULT NULL,
  `twitter_link` varchar(255) DEFAULT NULL,
  `cn_link` varchar(255) DEFAULT NULL,
  `bbb_accred` tinyint(1) DEFAULT NULL,
  `year_incorporated` int(11) DEFAULT NULL,
  `age` int(11) DEFAULT NULL,
  `purpose` varchar(255) DEFAULT NULL,
  `board_size` int(11) DEFAULT NULL,
  `staff_size` int(11) DEFAULT NULL,
  `tax_status` varchar(255) DEFAULT NULL,
  `tax_exempt` tinyint(1) DEFAULT NULL,
  `cn_rated` tinyint(1) DEFAULT NULL,
  `cn_overall` float(8,4) DEFAULT NULL,
  `cn_financial` float(8,4) DEFAULT NULL,
  `cn_acct_transp` float(8,4) DEFAULT NULL,
  `leader_compensation` varchar(255) DEFAULT NULL,
  `total_expenses` int(11) DEFAULT NULL,
  `total_contributions` int(11) DEFAULT NULL,
  `total_revenue` int(11) DEFAULT NULL,
  `percent_program` float(6,2) DEFAULT NULL,
  `percent_admin` float(6,2) DEFAULT NULL,
